import { axios } from 'hooks/worker'
import { IMovieAPIRes } from 'types/movie'

const BASE_URL = 'http://www.omdbapi.com'

interface Params {
  s: string
  page: number
}

export const getMovieSearchApi = (params: Params) =>
  axios.get<IMovieAPIRes>(`${BASE_URL}/`, {
    params: {
      apikey: '92e32667',
      ...params,
    },
  })
